// src/App.js
import React, { useState } from 'react';
import { uploadVideo } from './api';
import UploadForm from './Uploadform';
import ResultPlayer from './ResultPlayer';
import './index.css';

function App() {
  const [video, setVideo] = useState(null);
  const [loading, setLoading] = useState(false);
  const [summaryUrl, setSummaryUrl] = useState(null);

  const handleFileChange = (e) => {
    setVideo(e.target.files[0]);
    setSummaryUrl(null);
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!video) return;

    setLoading(true);
    try {
      const data = await uploadVideo(video);
      const fullUrl = `http://localhost:8000${data.summary_video_url}`;
      setSummaryUrl(fullUrl);
    } catch (err) {
      alert('Error: ' + err.message);
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
      <header className="navbar glass">
        <div className="logo">🎥 Clipify</div>
        <nav>
          <a href="#features">Features</a>
          <a href="#upload">Upload</a>
          <a href="https://github.com" target="_blank" rel="noreferrer">GitHub</a>
        </nav>
      </header>

      <section className="hero">
        <div className="hero-text">
          <h1>Turn Long Videos Into <span className="highlight">Short Summaries</span></h1>
          <p>Clipify uses AI to auto-generate quick summaries. Perfect for meetings, lectures, or content creators.</p>
          <a href="#upload" className="cta-button">Get Started</a>
        </div>
        <div className="hero-image">
          <img src="https://cdn-icons-png.flaticon.com/512/2204/2204346.png" alt="AI Summary" />
        </div>
      </section>

      <section id="features" className="features glass">
        <h2>✨ Why Clipify?</h2>
        <div className="feature-grid">
          <div className="feature-item">
            <h3>🤖 Automation</h3>
            <p>AI picks only the best moments from your video. Fully automated.</p>
          </div>
          <div className="feature-item">
            <h3>⚡ Speed</h3>
            <p>Get summarized videos in seconds without manual editing.</p>
          </div>
          <div className="feature-item">
            <h3>🎯 Simplicity</h3>
            <p>Just upload, click, and you're done. No skills required.</p>
          </div>
        </div>
      </section>

      <section id="upload" className="upload-section">
        <UploadForm
          video={video}
          loading={loading}
          onFileChange={handleFileChange}
          onUpload={handleUpload}
        />
        {summaryUrl && <ResultPlayer summaryUrl={summaryUrl} />}
      </section>

      <footer className="footer glass">
        <p>© 2025 Clipify · Built with React + FastAPI</p>
      </footer>
    </>
  );
}

export default App;
